import React from 'react';
import './Prices.css';

// Tämä komponentti näyttää hinnat
const Prices = () => {
    return (
        <div className="prices-container">
            <h2>Hinnasto</h2>
            <table className="prices-table">
                <thead>
                    <tr>
                        <th>Tuote</th>
                        <th>Hinta</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>Yarbocore</td>
                        <td>€2000</td>
                    </tr>
                    <tr>
                        <td>Akku</td>
                        <td>€500</td>
                    </tr>
                    <tr>
                        <td>Aura</td>
                        <td>€300</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
};

export default Prices;
